	width: 90%;
	max-width: 700px;
	display: flex;
	flex-direction: row;
	justify-content: center;
	align-items: center;
	${'' /* animation: easin 1s; */}

	@keyframes easein {
		from {
			opacity: 0;
		}
		to {
			opacity: 1;
		}
	}
`;

export default function HourlyForecast(props) {
	return <ForcastBar />;
}
